import React from "react";
import { useNavigate } from "react-router-dom";
import ContactBar from "./Components/ContactBar";
import AboutMe from "./Components/AboutMe";
import Navigation from "./Components/Navigation";

function Home() {
    let navigate = useNavigate();
  return (
    <div className="home">
        <ContactBar />
        <Navigation />
        <AboutMe />
        <div className="caseStudies">
            <div className="card" onClick={()=>{navigate("/work/JasonClerkID")}}>Jason Clerk ID</div>
            <div className="card" onClick={()=>{navigate("/work/SugarFlower")}}>Sugar {"&"} Flower</div>
            <div className="card" onClick={()=>{navigate("/work/Canada150")}}>Canada150</div>
            <div className="card" onClick={()=>{navigate("/work/McDonaldsGCTA")}}>McDonald's GCTA</div>
        </div>
    </div>
  );
}

export default Home;
